import React, { useEffect, useRef } from "react";
import s from "./skillsSection.module.css";
import Heading from "../../shared/Heading";
import { useInView } from "react-intersection-observer";
import { SectionWrapper } from "../../shared/SectionWrapper";

const SkillsSection = () => {
  const [ref, inView] = useInView();

  const htmlRef = useRef();

  //TODO: узнать как можно инкапсулировать такую логику

  useEffect(() => {
    let htmlSkill = document.getElementById("htmlSkill");
    let cssSkill = document.getElementById("cssSkill");
    let jsSkill = document.getElementById("jsSkill");
    let reactSkill = document.getElementById("reactSkill");
    let restApiSkill = document.getElementById("restApiSkill");
    if (inView) {
      htmlSkill?.classList.toggle(s.htmlSkillAppear);
      cssSkill?.classList.toggle(s.cssSkillAppear);
      jsSkill?.classList.toggle(s.jsSkillAppear);
      reactSkill?.classList.toggle(s.reactSkillAppear);
      restApiSkill?.classList.toggle(s.restApiSkillAppear);
    } else {
      htmlSkill?.classList.remove(s.htmlSkillAppear);
      cssSkill?.classList.remove(s.cssSkillAppear);
      jsSkill?.classList.remove(s.jsSkillAppear);
      reactSkill?.classList.remove(s.reactSkillAppear);
      restApiSkill?.classList.remove(s.restApiSkillAppear);
    }
  }, [inView]);

  return (
    <SectionWrapper id={"skills"} ref={ref} invertedColor>
      <div className={s.skillsContainer}>
        <Heading centered>
          My <span>skills</span>
        </Heading>

        <div className={s.skillsRow}>
          <div className={s.skillsColumn}>
            <h3 className={s.title}>Coding skills</h3>

            <div className={s.skillsBox}>
              <div className={s.skillsContent}>
                <div className={s.progress}>
                  <h3>
                    Html <span>100%</span>
                  </h3>
                  <div className={s.bar}>
                    <span id={"htmlSkill"}></span>
                  </div>
                </div>
                <div className={s.progress}>
                  <h3>
                    CSS <span>100%</span>
                  </h3>
                  <div className={s.bar}>
                    <span id={"cssSkillAppear"}></span>
                  </div>
                </div>
                <div className={s.progress}>
                  <h3>
                    JavaScript / TypeScript <span>80%</span>
                  </h3>
                  <div className={s.bar}>
                    <span id={"jsSkillAppear"}></span>
                  </div>
                </div>
                <div className={s.progress}>
                  <h3>
                    React / Redux <span>70%</span>
                  </h3>
                  <div className={s.bar}>
                    <span id={"reactSkillAppear"}></span>
                  </div>
                </div>
                <div className={s.progress}>
                  <h3>
                    RestAPI <span>70%</span>
                  </h3>
                  <div className={s.bar}>
                    <span id={"restApiSkillAppear"}></span>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </SectionWrapper>
  );
};

export default SkillsSection;
